import "bootstrap/dist/css/bootstrap.min.css";

const UserTable = (props) => {
    const data = props.names;

    return (
        <div>
            <table>
                <thead>
                    <tr>
                        <th>ID</th>
                        <th>Name</th>
                    </tr>
                </thead>
                <tbody>
                    <tr>
                        <td>
                            {
                                Object.keys(data).map((key, index) => (
                                    <p key={index}>{key}</p>
                                ))
                            }
                        </td>
                        <td>
                            {
                                Object.keys(data).map((key, index) => (
                                    <p key={index}>{data[key]}</p>
                                ))
                            }
                        </td>
                    </tr>
                </tbody>
            </table>
        </div>
    );
}

export default UserTable;
